import React from 'react'
import ReactDOM from 'react-dom'

function DescriptionComponent(){
	return(
		<div class="description-container">
			<p>I am currently a Year 1 Computer Science Student in NUS</p>
			<p>I will be working on projects to expand my skillset and documenting them within this page</p>
		</div>
	)
}

export default DescriptionComponent
